import React from 'react';
import { PageContainer } from '@ant-design/pro-components';
import { ProTable } from '@ant-design/pro-components';
import { Card, Button, Space, Tag, Switch, message } from 'antd';
import { PlusOutlined, EditOutlined, DeleteOutlined, CopyOutlined } from '@ant-design/icons';

interface Rule {
  id: string;
  name: string;
  category: string;
  description: string;
  status: boolean;
  priority: string;
  version: string;
  creator: string;
  createTime: string;
  updateTime: string;
}

const Rules: React.FC = () => {
  // 模拟数据
  const mockData: Rule[] = [
    {
      id: 'rule-1',
      name: '用户权限验证规则',
      category: 'business',
      description: '验证用户是否有权限访问特定资源',
      status: true,
      priority: 'high',
      version: '1.0.0',
      creator: '张三',
      createTime: '2024-01-15 10:30:00',
      updateTime: '2024-01-15 10:30:00',
    },
    {
      id: 'rule-2',
      name: '订单金额计算规则',
      category: 'calculation',
      description: '根据商品数量和折扣计算订单总金额',
      status: true,
      priority: 'medium',
      version: '2.1.0',
      creator: '李四',
      createTime: '2024-01-14 15:20:00',
      updateTime: '2024-01-14 15:20:00',
    },
    {
      id: 'rule-3',
      name: '库存检查规则',
      category: 'validation',
      description: '检查商品库存是否充足',
      status: false,
      priority: 'high',
      version: '1.5.0',
      creator: '王五',
      createTime: '2024-01-13 09:15:00',
      updateTime: '2024-01-13 09:15:00',
    },
  ];

  const columns = [
    {
      title: '规则名称',
      dataIndex: 'name',
      key: 'name',
      render: (text: string, record: Rule) => (
        <Space direction="vertical" size="small">
          <span style={{ fontWeight: 'bold' }}>{text}</span>
          <span style={{ color: '#666', fontSize: '12px' }}>{record.description}</span>
        </Space>
      ),
    },
    {
      title: '分类',
      dataIndex: 'category',
      key: 'category',
      render: (text: string) => {
        const colorMap: { [key: string]: string } = {
          business: 'blue',
          calculation: 'green',
          validation: 'orange',
          decision: 'purple',
        };
        return <Tag color={colorMap[text] || 'default'}>{text}</Tag>;
      },
    },
    {
      title: '优先级',
      dataIndex: 'priority',
      key: 'priority',
      render: (text: string) => {
        const colorMap: { [key: string]: string } = {
          high: 'red',
          medium: 'orange',
          low: 'green',
        };
        return <Tag color={colorMap[text] || 'default'}>{text}</Tag>;
      },
    },
    {
      title: '状态',
      dataIndex: 'status',
      key: 'status',
      render: (status: boolean) => (
        <Switch 
          checked={status} 
          onChange={(checked) => handleStatusChange(checked)}
        />
      ),
    },
    {
      title: '版本',
      dataIndex: 'version',
      key: 'version',
      render: (text: string) => <Tag color="blue">v{text}</Tag>,
    },
    {
      title: '创建人',
      dataIndex: 'creator',
      key: 'creator',
    },
    {
      title: '更新时间',
      dataIndex: 'updateTime',
      key: 'updateTime',
    },
    {
      title: '操作',
      key: 'action',
      render: (_, record: Rule) => (
        <Space>
          <Button type="link" icon={<EditOutlined />}>
            编辑
          </Button>
          <Button type="link" icon={<CopyOutlined />}>
            复制
          </Button>
          <Button type="link" danger icon={<DeleteOutlined />}>
            删除
          </Button>
        </Space>
      ),
    },
  ];

  const handleStatusChange = (checked: boolean) => {
    message.success(`规则状态已${checked ? '启用' : '禁用'}`);
  };

  return (
    <PageContainer
      title="规则管理"
      extra={
        <Button icon={<PlusOutlined />} type="primary">
          创建规则
        </Button>
      }
    >
      <Card>
        <ProTable<Rule>
          columns={columns}
          dataSource={mockData}
          rowKey="id"
          search={{
            labelWidth: 120,
          }}
          pagination={{
            pageSize: 10,
            showSizeChanger: true,
            showQuickJumper: true,
          }}
          toolBarRender={false}
        />
      </Card>
    </PageContainer>
  );
};

export default Rules;

